import { Link } from "react-router-dom";

function Main() {
  return (
    <div className=" flex flex-col justify-center items-center ml-[-200px] mt-[570px]">
      <Link to="/walletConnect">
        <button className="absolute bg-lightYellow btn-style">회원가입</button>
      </Link>

      <div className=" flex  justify-center items-center ml-[-230px] mt-[100px]"></div>
      <Link to="/signup">
        <button className="absolute bg-stone btn-style">로그인</button>
      </Link>
    </div>
  );
}
export default Main;

